var zRatio = 1.1;
var controlLinksGraph = function(what) {
  var c = linksGraph.camera;
  if(what=='reset')
    c.goTo({ ratio: 1, x: 0, y: 0 });
  if(what=='zoomin')
    c.goTo({ ratio: c.ratio / zRatio });
  if(what=='zoomout')
    c.goTo({ ratio: c.ratio * zRatio });
};

